import React from "react";
// import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import { useInitialContext } from "../context/InitialContext";

export default function Navbar(PropTypes) {
  // if (typeof title === "string") {
  //   console.log("its string");
  // }
  // if (typeof quiz === "string") {
  //   console.log("its string");
  // }

  // typeof quiz === "string" ? true : false;
  const { zoneAndDivisionLoading, zoneAndDivisionData, zoneAndDivisionError } =
    useInitialContext();

  return (
    <ul className="nav nav-tabs">
      <li className="nav-item">
        <b className="nav-link active" aria-current="page" href="/">
          {PropTypes.title}
        </b>
      </li>
      <li className="nav-item dropdown">
        <b
          className="nav-link dropdown-toggle"
          data-bs-toggle="dropdown"
          href="/"
          role="button"
          aria-expanded="false"
        >
          {PropTypes.quiz}
        </b>
        <ul className="dropdown-menu">
          <li>
            <b className="dropdown-item" href="/">
              <Link to="/QuizSetup">MCQ</Link>
            </b>
          </li>
          <li>
            <b className="dropdown-item" href="/">
              <Link to="/ShowFeedback">Show User Feedback</Link>
            </b>
          </li>
          <li>
            <b className="dropdown-item" href="/">
              Admin Login
            </b>
          </li>
          <li>
            <b className="dropdown-item" href="/">
              User Login
            </b>
          </li>

          <li>
            <hr className="dropdown-divider" />
          </li>
        </ul>
      </li>
      <li className="nav-item">
        <b className="nav-link" href="/">
          <Link to="/LoginPages">User Login</Link>
        </b>
      </li>
      <li className="nav-item">
        <b className="nav-link" href="/">
          <Link to="/FeedBack_user">User Feedback</Link>
        </b>
      </li>
      <li className="nav-item">
        <b className="nav-link" href="/">
          <Link to="/About">About us</Link>
        </b>
      </li>

      <li className="nav-item">
        <b className="nav-link" href="/">
          <Link to="/Plan">Plan</Link>
        </b>
      </li>

      {/* <li className="nav-item">
        <b className="nav-link" href="/">
          <Link to="/ShowFeedback">ShowFeedback</Link>
        </b>
      </li> */}
    </ul>
  );

  // Navbar.PropTypes = { title: PropTypes.string, aboutText: PropTypes.string };
}
